import './App.css';
import ImageMapper from 'react-image-mapper';

import React, { useState } from "react";
import axios from 'axios'
import one  from './one.jpeg'
import logo from './logo.svg';


class SignInScreen extends React.Component 
{
render() {

    return (
        <div>
          <SignedInComponent> </SignedInComponent>
        </div>
    );
  };
}


 function SignedInComponent() 
{

  return (
    <section className = "section">
    <div className = "Container1">
          <h1> Welcome1</h1> 
          {/* <img src={one} className="App-logo" alt="logo" /> */}
          <img src= {one} alt="Workplace" usemap="#workmap" width="500" height="579"/>
{/* <img src={require('/Users/jschultz/Desktop/CS5356/StartupSystems/FrontEnd2/src/one.jpeg')} /> */}

<map name="workmap">
  <area shape="rect" coords="34,44,270,350" alt="Computer" href="computer.htm" strokeColor = "black" fillcolor ="red" />
  <area shape="rect" coords="290,172,333,250" alt="Phone" href="phone.htm"/>
  <area shape="circle" coords="337,300,44" alt="Cup of coffee" href="coffee.htm"/>
</map>

<div className="container">
    <ImageMapper src={one}  width={500}
    	onLoad={() => this.load()}
    	onClick={area => this.clicked(area)}
    	onMouseEnter={area => this.enterArea(area)}
    	onMouseLeave={area => this.leaveArea(area)}
    	onMouseMove={(area, _, evt) => this.moveOnArea(area, evt)}
    	onImageClick={evt => this.clickedOutside(evt)}
    	onImageMouseMove={evt => this.moveOnImage(evt)}
    />
    {
    	this.state.hoveredArea &&
    	<span className="tooltip"
    	    style={{ ...this.getTipPosition(this.state.hoveredArea)}}>
    		{ this.state.hoveredArea && this.state.hoveredArea.name}
    	</span>
    }
</div>


    </div>

    </section>



  )
}








export default SignInScreen;
